import React from 'react'

const SearchBar = () => {
  return (
    <div className='search-bar'>
         <i className="fa-sharp fa-solid fa-magnifying-glass"></i>
        <input 
            type="text" 
            placeholder='type to search...'
            onChange={(event)=>setSearchText(event.target.value)} 
         />
    </div>
  )
}

export default SearchBar
